import React, { Component } from 'react';
import './ManageIPO.css';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import Button from 'react-bootstrap/Button';
import { DropdownButton,Dropdown} from 'react-bootstrap';
import NavWithDropDown from '../NavBar';
import Card from 'react-bootstrap/Card';

export class IPOCard extends Component {

    constructor(props){
        super(props);
    }

    render(){

        return(
                    <Card bg="dark" id="each-card" text="white" style={{ width: '10px' }} className="mb-2">
                        <Card.Header>Sector : {this.props.companySector}</Card.Header>
                        <Card.Body>
                        <Card.Title>{this.props.companyName}</Card.Title>
                        <Card.Text>
                            {this.props.companyBrief}
                        </Card.Text>
                        <Card.Link href={`/company/${this.props.companyName}`}>Click here to know more</Card.Link>
                        </Card.Body>
                    </Card>  
            
        );
    }
}

class ManageIPO extends Component{
    constructor(props){
        super(props);
        this.state = {
            data : []
        }
    }

    componentDidMount(){
        console.log("token" + this.props.getAuthToken());
        var requestOptions = {
            method : 'GET',
            headers : {"Authorization" : "Bearer " + this.props.getAuthToken() }
        }
        fetch("http://localhost:8082/company/ipo/getIPO",requestOptions)
        .then(response =>  response.json())
        .then(data => {
            this.setState({data : data});
        })
    }

    render(){
        return(
            <React.Fragment>
                <NavWithDropDown />

            </React.Fragment>
        );
    }
}

export default ManageIPO;
